INSERT INTO `v1_afc448f03723824000bd3187c59c9a51acbe7c766c527e0174fc37abf5615943` VALUES (/*3e51d0c96bdb6aa20a2e99459cd2a4867f34783f249c6f14930e0d1345694f13*/1405, /*d83f8db3b194e5b30edee8a16f26b9d53167bde10f17fa092d4ceeadedd734b4*/1, /*e6011b8a3c8292a969cc94521a4b270877a410b84b9f6dfd12a4bc1e8e54701f*/"その身をコマの如く回転させ、オーエド町の空をより遠くへ飛んだ者へ贈られるトロフィー。金色ハートは極限の状況によりもたらされる勇気と冒険心を称えるもの、ということになっている。なお大変危険なので大回転のマネ事は厳禁！", /*cdefda838013aeeb1fbd75b84c421e6b4d5f8a08512daf8106da7e0519bf0c44*/0, /*f44003aadc85d18263d244074ee00443c161469d118a141e996fa2fb974f081f*/0, /*ac5fd2f931cd3f64838c8bc0d2dd5217c3a50fda4eb13030b52b184f534632aa*/0, /*c725b2f0159a1ed07cff075188fb9a41708a7935b57d642df12b2278433b92b6*/0, /*37bbf00ab5ed3610c544afa1403c3e1f4074aa84b49499e3aa1475829e757a64*/0, /*9500ab498ecb5b3612d72d78c2c5baea5d74dfd7d3091a5daa88244e62e24b22*/0, /*4d7fed6609209727685e4a3a1e48ec7545d548ba63ae3adb56a541923510ab32*/0, /*273145448f498d5299b1ed7396ec69972d314e3f24b945bc6543477d188cea2d*/0, /*abd96af36c264a7b28d251cdbb40771f039b23f4ffb2e7bf46d01dd8afe2e6b4*/0, /*9bc98ca3fe0ac765db37c6d2d0005146b8152837beff841a1ba7330f22ea46dd*/0);
