INSERT INTO `v1_afc448f03723824000bd3187c59c9a51acbe7c766c527e0174fc37abf5615943` VALUES (/*3e51d0c96bdb6aa20a2e99459cd2a4867f34783f249c6f14930e0d1345694f13*/1604, /*d83f8db3b194e5b30edee8a16f26b9d53167bde10f17fa092d4ceeadedd734b4*/1, /*e6011b8a3c8292a969cc94521a4b270877a410b84b9f6dfd12a4bc1e8e54701f*/"甘い香りが漂ってきそうな花柄の椅子。デザインはおしゃれ寄りだが作りは頑丈で、花のような儚さとは無縁。末永くあなたと共に。", /*cdefda838013aeeb1fbd75b84c421e6b4d5f8a08512daf8106da7e0519bf0c44*/0, /*f44003aadc85d18263d244074ee00443c161469d118a141e996fa2fb974f081f*/0, /*ac5fd2f931cd3f64838c8bc0d2dd5217c3a50fda4eb13030b52b184f534632aa*/0, /*c725b2f0159a1ed07cff075188fb9a41708a7935b57d642df12b2278433b92b6*/0, /*37bbf00ab5ed3610c544afa1403c3e1f4074aa84b49499e3aa1475829e757a64*/0, /*9500ab498ecb5b3612d72d78c2c5baea5d74dfd7d3091a5daa88244e62e24b22*/0, /*4d7fed6609209727685e4a3a1e48ec7545d548ba63ae3adb56a541923510ab32*/0, /*273145448f498d5299b1ed7396ec69972d314e3f24b945bc6543477d188cea2d*/0, /*abd96af36c264a7b28d251cdbb40771f039b23f4ffb2e7bf46d01dd8afe2e6b4*/0, /*9bc98ca3fe0ac765db37c6d2d0005146b8152837beff841a1ba7330f22ea46dd*/0);
INSERT INTO `v1_afc448f03723824000bd3187c59c9a51acbe7c766c527e0174fc37abf5615943` VALUES (/*3e51d0c96bdb6aa20a2e99459cd2a4867f34783f249c6f14930e0d1345694f13*/1605, /*d83f8db3b194e5b30edee8a16f26b9d53167bde10f17fa092d4ceeadedd734b4*/1, /*e6011b8a3c8292a969cc94521a4b270877a410b84b9f6dfd12a4bc1e8e54701f*/"置くだけで部屋が一気に華やぐ一人掛けソファ。ライトなスタイルながら座り心地にもこだわった本格派。長時間座っても疲れないので、幅広い世代から支持を受ける愛され家具。", /*cdefda838013aeeb1fbd75b84c421e6b4d5f8a08512daf8106da7e0519bf0c44*/0, /*f44003aadc85d18263d244074ee00443c161469d118a141e996fa2fb974f081f*/0, /*ac5fd2f931cd3f64838c8bc0d2dd5217c3a50fda4eb13030b52b184f534632aa*/0, /*c725b2f0159a1ed07cff075188fb9a41708a7935b57d642df12b2278433b92b6*/0, /*37bbf00ab5ed3610c544afa1403c3e1f4074aa84b49499e3aa1475829e757a64*/0, /*9500ab498ecb5b3612d72d78c2c5baea5d74dfd7d3091a5daa88244e62e24b22*/0, /*4d7fed6609209727685e4a3a1e48ec7545d548ba63ae3adb56a541923510ab32*/0, /*273145448f498d5299b1ed7396ec69972d314e3f24b945bc6543477d188cea2d*/0, /*abd96af36c264a7b28d251cdbb40771f039b23f4ffb2e7bf46d01dd8afe2e6b4*/0, /*9bc98ca3fe0ac765db37c6d2d0005146b8152837beff841a1ba7330f22ea46dd*/0);
INSERT INTO `v1_afc448f03723824000bd3187c59c9a51acbe7c766c527e0174fc37abf5615943` VALUES (/*3e51d0c96bdb6aa20a2e99459cd2a4867f34783f249c6f14930e0d1345694f13*/1606, /*d83f8db3b194e5b30edee8a16f26b9d53167bde10f17fa092d4ceeadedd734b4*/1, /*e6011b8a3c8292a969cc94521a4b270877a410b84b9f6dfd12a4bc1e8e54701f*/"温かみのある花柄の二人掛けソファ。華やかな色合いがぬくもりを感じさせるおかげか、隣に座る相手がいなくても不思議と寂しくない。寂しくないのだ。", /*cdefda838013aeeb1fbd75b84c421e6b4d5f8a08512daf8106da7e0519bf0c44*/0, /*f44003aadc85d18263d244074ee00443c161469d118a141e996fa2fb974f081f*/0, /*ac5fd2f931cd3f64838c8bc0d2dd5217c3a50fda4eb13030b52b184f534632aa*/0, /*c725b2f0159a1ed07cff075188fb9a41708a7935b57d642df12b2278433b92b6*/0, /*37bbf00ab5ed3610c544afa1403c3e1f4074aa84b49499e3aa1475829e757a64*/0, /*9500ab498ecb5b3612d72d78c2c5baea5d74dfd7d3091a5daa88244e62e24b22*/0, /*4d7fed6609209727685e4a3a1e48ec7545d548ba63ae3adb56a541923510ab32*/0, /*273145448f498d5299b1ed7396ec69972d314e3f24b945bc6543477d188cea2d*/0, /*abd96af36c264a7b28d251cdbb40771f039b23f4ffb2e7bf46d01dd8afe2e6b4*/0, /*9bc98ca3fe0ac765db37c6d2d0005146b8152837beff841a1ba7330f22ea46dd*/0);
INSERT INTO `v1_afc448f03723824000bd3187c59c9a51acbe7c766c527e0174fc37abf5615943` VALUES (/*3e51d0c96bdb6aa20a2e99459cd2a4867f34783f249c6f14930e0d1345694f13*/1607, /*d83f8db3b194e5b30edee8a16f26b9d53167bde10f17fa092d4ceeadedd734b4*/1, /*e6011b8a3c8292a969cc94521a4b270877a410b84b9f6dfd12a4bc1e8e54701f*/"シックな佇まいに一輪の花が映えるクローゼット。気付くと花柄の服ばかりしまい込んでしまう不思議。花に魅せられたのかもしれないし、そうではないのかもしれない。", /*cdefda838013aeeb1fbd75b84c421e6b4d5f8a08512daf8106da7e0519bf0c44*/0, /*f44003aadc85d18263d244074ee00443c161469d118a141e996fa2fb974f081f*/0, /*ac5fd2f931cd3f64838c8bc0d2dd5217c3a50fda4eb13030b52b184f534632aa*/0, /*c725b2f0159a1ed07cff075188fb9a41708a7935b57d642df12b2278433b92b6*/0, /*37bbf00ab5ed3610c544afa1403c3e1f4074aa84b49499e3aa1475829e757a64*/0, /*9500ab498ecb5b3612d72d78c2c5baea5d74dfd7d3091a5daa88244e62e24b22*/0, /*4d7fed6609209727685e4a3a1e48ec7545d548ba63ae3adb56a541923510ab32*/0, /*273145448f498d5299b1ed7396ec69972d314e3f24b945bc6543477d188cea2d*/0, /*abd96af36c264a7b28d251cdbb40771f039b23f4ffb2e7bf46d01dd8afe2e6b4*/0, /*9bc98ca3fe0ac765db37c6d2d0005146b8152837beff841a1ba7330f22ea46dd*/0);
